export default function itemPrev({item}){

    
    function getImages() {
        if (item.images != null) {
            return item.images.map((image) => {
                return <img src={image} alt="img" />
            })
        }
    }

    return (<>

        <div>{item.title}</div>
        {getImages()}
        <div>{item.description}</div>
        <div>{item.price}</div>

    
    </>)
}
